import './App.css';
import AboutMe from './components/AboutMe';
import ContactForm from './components/Contact';
import NavBar from './components/Nav';

function App() {
  return (
    <div className="App">
      <main>
        <Navbar />
        <AboutMe></AboutMe>     
        <ContactForm></ContactForm>
         </main>

    </div>
  );
}

export default App;
